from PyQt5 import QtGui
import base64
import os

def Get_PyctureIcon(image_str):
    ImageStr = base64.b64decode(image_str)
    with open("PyctureIcon.png", "wb") as PyctureIcon_text:
        PyctureIcon_text.write(ImageStr)
    PyctureIcon_text.close()
    return(QtGui.QIcon("PyctureIcon.png"))
        
def Remove_PyctureIcon():
    os.remove("PyctureIcon.png")
    return 0
        
